Filmstar Fish: Struggling for Survival

Nature Documentary hosted by John Boyle, published by ZDF in 2011 - English narration 
also known as


Information
------------------------------

The Academy Award-winning animated movie &quot;Finding Nemo&quot; was a financial blockbuster. Ironically, the movie's message of conservation has been swamped. Now everyone wants their own Nemo, with soaring demand driving a hugely profitable tropical fish industry. Twenty million clownfish, worth $ 500 million will be taken from the wild this year. Featuring all new HD footage of the lives of these fascinating creatures, this new documentary investigates the impact the movie has had on their survival.

